@el_bru Gana River 3 a 0. Hacerle un planteo abierto es suicida. Es cierto que River es el mejor equipo por lejos. 

Igual lo banco a Heinze. Para mí es el mejor DT del fútbol argentino.
Sin ser tan kamikaze, hay cierto romanticismo Bielsista en algunos de sus planteos.

@Pedro_Olaechea Sabe que asusta?
La sarta de impresentables que ustedes proponen, solo para mencionar uno, el abogado del suicida AG, le queda claro?
Usted será recordado como presidente de uno de los peores congresos de la historia republicana, ojalá lo disuelvan.
